import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import { useState } from 'react';
import { useNavigate } from "react-router-dom";

import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemIcon from '@mui/material/ListItemIcon';
import LooksOneIcon from '@mui/icons-material/LooksOne';
import LooksTwoIcon from '@mui/icons-material/LooksTwo';
import Looks3Icon from '@mui/icons-material/Looks3';
import Looks4Icon from '@mui/icons-material/Looks4';
import Box from '@mui/material/Box';

import Navbar from "./Navbar";
import '../styles/Confirm.css'
import { Typography } from '@mui/material';
import { red } from '@mui/material/colors';

const Confirm = () => {

    const [check, setCheck] = useState([]);
    const handleChange = () => {
        setCheck(!check);
    };

    const [show, setShow] = useState(false);



    return (
        <>
            <Navbar />
            <Box 
                sx={{
                marginTop: '20px',
                width: '90%',
                textAlign: 'center',
                boxShadow: 'rgba(0, 0, 0, 0.24) 0px 3px 8px;',
                backgroundColor: 'rgba(255, 236, 219, 0.7)',
            }}>
                <Typography variant="h5" sx={{fontWeight: 'bold', fontFamily: 'Monospace'}}>Så här går du tillväga</Typography>
                <List>
                    <ListItem>
                        <ListItemIcon>
                            <LooksOneIcon fontSize='large' sx={{color: 'black'}} />
                        </ListItemIcon>
                        <ListItemText >
                            Lägg kläderna i samma kartong som de kom i.
                        </ListItemText>
                    </ListItem>
                    <ListItem>
                        <ListItemIcon>
                            <LooksTwoIcon fontSize='large' sx={{color: 'black'}} />
                        </ListItemIcon>
                        <ListItemText>
                            Ta med kartongen till Nacka Kommun.
                        </ListItemText>
                    </ListItem>
                    <ListItem>
                        <ListItemIcon>
                            <Looks3Icon fontSize='large' sx={{color: 'black'}} />
                        </ListItemIcon>
                        <ListItemText>
                            Vid inlämning av ditt paket sker utlämning av nytt paket.
                        </ListItemText>
                    </ListItem>
                    <ListItem>
                        <ListItemIcon>
                            <Looks4Icon fontSize='large' sx={{color: 'black'}} />
                        </ListItemIcon>
                        <ListItemText>
                            Du får en notis i appen när du har lämnat och hämtat upp ditt nya paket. 
                        </ListItemText>
                    </ListItem>
                </List>
                <FormGroup>
                    <FormControlLabel control={<Checkbox color='success' onChange={handleChange} onClick={() => setShow(!show)} />} label="Jag har läst och förstått instruktionerna" />
                </FormGroup>
                    </Box>
                <div>
                    {
                      show && <button className='selectBTN'>OKEJ</button>
                    }
                </div>
        </>
    );
}

export default Confirm;
